import React from 'react'

function Parallax() {
    return (
        <div className="parallax mt-">
            <h3>Want to  <span> publish your blog</span> with us?</h3>
            <div className="my-btn text-center">
                <a data-toggle="modal" data-target="#exampleModalCenter" className="amitBtn">Write for us</a>
            </div>
        </div>
    )
}

export default Parallax
